ime: 22139.79 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.8.161:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 63 &lt;/li&gt;\n          &lt;li&gt; Threads: 1512 &lt;/li&gt;\n          &lt;li&gt; Memory: 10.63 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import InSituIncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n\n    l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1383","type":"BasicTicker"},{"attributes":{"overlay":{"id":"1060"}},"id":"1057","type":"BoxZoomTool"},{"attributes":{"axis":{"id":"1382"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1385","type":"Grid"},{"attributes":{},"id":"1053","type":"BasicTicker"},{"attributes":{},"id":"1449","type":"NoOverlap"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1337"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1339"},"nonselection_glyph":{"id":"1338"},"view":{"id":"1341"}},"id":"1340","type":"GlyphRenderer"},{"attributes":{},"id":"1480","type":"AllLabels"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1550"},{"id":"1551"},{"id":"1552"},{"id":"1553"},{"id":"1554"},{"id":"1555"},{"id":"1556"},{"id":"1557"},{"id":"1558"},{"id":"1559"},{"id":"1560"},{"id":"1561"}]},"id":"1379","type":"DatetimeTicker"},{"attributes":{"line_alpha":0.1,"line_color":"blue","x":{"field":"time"},"y":{"field":"write_bytes"}},"id":"1338","type":"Line"},{"attributes":{"coordinates":null,"formatter":{"id":"1492"},"group":null,"major_label_policy":{"id":"1493"},"ticker":{"id":"1383"}},"id":"1382","type":"LinearAxis"},{"attributes":{"callback":null},"id":"1056","type":"TapTool"},{"attributes":{},"id":"1474","type":"AllLabels"},{"attributes":{},"id":"1447","type":"CategoricalTickFormatter"},{"attributes":{"coordinates":null,"group":nu
